import {Route, Switch, BrowserRouter } from "react-router-dom";

/* Views */
import Home from "./views/Home";

/* Components */
import Nav from "./components/Nav";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
        <Nav/>

      <BrowserRouter>
        <Switch>
            <Route path="/" exact component={Home}/>
        </Switch>
      </BrowserRouter>
      <Footer/>
    </div>
  );
}

export default App;
